import React, { useState } from "react";
import "../styles/Commons.css";
import emblem from "../svg/glasses-with-circular-lenses-svgrepo-com.svg";

const Commons = {
    main: function() {
        return (
            <div className="main-view" >
                <div className="title">
                    <h1 className="title">
                        <img src={emblem} alt="" />
                        COMMONS
                    </h1>
                </div>  
                <ul className="links">
                    <li className="link">
                        <a href="/commons/documentation">
                            <img src={emblem} alt="" />
                            <Documentation></Documentation></a>
                    </li>
                    <li className="link">
                        <a href="/commons/message-boards">Message Boards</a>
                    </li>
                    <li className="link">
                        <a href="/commons/external-resources">External Resources</a>
                    </li>
                </ul>
            </div>
        );
    },
    docs: function() {

    }
};

export default Commons;
